import { CardListProps } from "modules/ProductList/types";
import {
	CardProduct,
	ProductListWrapper,
	NewProductsWrapper,
} from "modules/ProductList/ProductListStyled";
import Text from "components/Text/Text";

import Product from "components/Product/Product";
import products from "products";

const ProductList = ({ children }: CardListProps): any => {
	return (
		<NewProductsWrapper>
			<Text variant='h2'>New products</Text>

			<ProductListWrapper>
				{products.map((product): any => (
					<CardProduct key={product.vendorСode}>
						<Product product={product} />
						{console.log(product)}
					</CardProduct>
				))}
			</ProductListWrapper>
		</NewProductsWrapper>
	);
};

export default ProductList;
